import React from "react";
import styles from "./styles.module.css";

function Comb(props) {
  let { comb1 } = props;
  // console.log(comb1.combId);

  return (
    <div name={styles.wrap}>
      <h4>{comb1.flavorName}</h4>
      <p>
        <img src={comb1.imageUrl} className={styles.img} />
      </p>
      <p className={styles.description}>{comb1.description} </p>
    </div>
  );
}

export default Comb;
